import './App.css';
import ListInvestmentComponent from './components/ListInvestmentComponent';
import HeaderComponent from './components/Header/HeaderComponent';
import Sidebar from './components/Sidebar/sidebar';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import FeaturedInfo from './components/Features/FeaturedInfo';

function App() {
  return (

    <Router>
      <HeaderComponent/>
      <div className="test">
        <Sidebar/>
        <div className="container">
          <Routes>
              <Route path='/' component = {FeaturedInfo} ></Route>
              <Route path='/investments' component = {ListInvestmentComponent} ></Route>
          </Routes>
         </div>
      </div>

    </Router>
      
    
  );
}

export default App;
